import React, { Component } from 'react'
import Image from 'react-bootstrap/Image'

const styles = StyleSheet.create({
    cont: {
        borderStyle: 'solid'
    }
})

const Itinerary = ({ itinerary }) => <div>
    <div className="d-flex justify-content-between mt-5"> style={{borderStyle: "solid"}}
        <Image
            className="d-block w-25 h-25"
            src={itinerary.profilePicture}
            fluid roundedCircle/>
            <h4>{itinerary.title}</h4>
            <div></div>
    </div>
</div>;

export default Itinerary;
